import PropTypes from 'prop-types';

const Header = ({title}) => {
    return (
        <header className='header'>
            <h1 style={{color: 'orange', backgroundColor: 'beige'}}>{title}</h1>
            <button className='btn'>Add</button>
        </header>
    )
}

Header.defaultProps = {
    title: 'Task Tracker',
}

Header.propTypes = {
    title: PropTypes.string.isRequired,
}
export default Header
